import '../css/header.css'

const Header = () => {
    return (
        <div id="header">            
                <div id="logo"><img src="../public/logo.png" alt="Logo" /></div>
                <div><button id="search">검색</button></div>
            <hr />
        </div>
    )
}
export default Header;
